import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class AnnonceService {
  private annoncecar=[{
    id:"1",
    title:"fiat",
    image:"https://upload.wikimedia.org/wikipedia/commons/thumb/7/70/Fiat_500_%282007%29_01.JPG/250px-Fiat_500_%282007%29_01.JPG"
  },

  { id:"2",
    title:"audi",
    image:"https://images.caradisiac.com/images/7/3/0/0/197300/S1-essai-audi-a3-audi-a3-45-tfsie-2022-l-agrement-avant-l-economie-721946.jpg"
    }]
    private annoncebike=[{
      id:"1",
      title:"honda",
      image:"data:image/jpeg;base64,"
    },

    { id:"2",
      title:"103",
      image:"data:image/jpeg;base64,"
      }]
  constructor() { }
  getAnnoncecar() {
    return this.annoncecar;
  }
  getAnnonceById(id) {
    return this.annoncecar.find((e) => e.id == id);
  }
  deleteannonceById(c) {
    let i = this.annoncecar.indexOf(c);
    this.annoncecar.splice(i, 1);
  }
  addannonce(newAnnonce) {
    newAnnonce.id = this.annoncecar[this.annoncecar.length - 1].id + 1;
    this.annoncecar.push(newAnnonce);
  }
  getAnnoncebike() {
    return this.annoncebike;
  }
  getAnnoncebikeById(id) {
    return this.annoncebike.find((e) => e.id == id);
  }
  deleteannoncebikeById(c) {
    let i = this.annoncebike.indexOf(c);
    this.annoncebike.splice(i, 1);
  }
  addannoncebike(newAnnonce) {
    newAnnonce.id = this.annoncebike[this.annoncebike.length - 1].id + 1;
    this.annoncebike.push(newAnnonce);
  }
}

